import React from 'react';
import { Image, StyleSheet, Text, View, TouchableOpacity } from 'react-native';

import Slider from '@react-native-community/slider';

export default function App() {
  return (
    <View style={styles.container}>
      <Image
        source={require('./src/img/logo.png')}
        style={styles.logo}
      />

      <Text style={ styles.text }> 12 caracteres</Text>
      <View></View>

      <Slider
        style={{ height: 50 }}
        minimumValue={5}
        maximumValue={10}
        minimumTrackTintColor="red"
        maximumTrackTintColor="black"
      />

      <TouchableOpacity style={styles.button}>
        <Text style={styles.text}>Gerar Senha</Text>
      </TouchableOpacity>
      <View>
        <Text style={styles.password}>asdasdasd</Text>
      </View>

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'pink',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    marginBottom: 60,
    fontWeight: 'bold'
  },
  title: {
    fontSize: 15,
    margin: 15,
    borderRadius: 7,
    backgroundColor: '#fff',
    width: '90%'
  },
  button:{
    backgroundColor: '#ffa200',
    width: '90%',
    height: 50,
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 7,
    marginBottom: 25,
  },
  text: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  password: {
    padding: 10,
    textAlign: 'center'

  }
});
